//       dark: '#009688',
//     },
//   },
// });

const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 400,
  bgcolor: 'background.paper',
  border: '5px solid #94ECF5',
  boxShadow: 24,
  p: 4,
};



export default function DataModal({selectedData}) {
  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  console.log("selectedData: ", selectedData)

  return (
    <div>
      <Button onClick={handleOpen}>Details</Button>
      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>
          <Typography id="modal-modal-title" variant="h6" component="h2" >Detailed Data</Typography>
          <Typography id="modal-modal-description" sx={{ mtbp: 2 }}>

            <div>
                ID: {selectedData.id},
                Name: {selectedData.name},
                User Name: {selectedData.username},
                Email: {selectedData.email},
                Phone: {selectedData.phone}, 
                Website: {selectedData.website}
            </div>
                
            </Typography>
        </Box>
      </Modal>
    </div>
  );
}
